import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div>
      <Router>
    <Navbar></Navbar>
      <Route path='/' exact></Route>
    </Router>
    </div>
  );
}

export default App;
